import React, { FunctionComponent } from 'react';
import './contactSection.scss';

const ContactSection : FunctionComponent = () => {
    
 return (
    <div className="row contact-row">
        <div className="col s12 contact-col">
            <div className="black-text center-align">
                span
                <i className="material-icons pink-bar">mail</i>&nbsp;<a className="link-contact" href="mailto:florencejacobs85@gmail.com">florencejacobs85@gmail.com</a>
                <i className="material-icons">phone_android</i>&nbsp;<a className="link-contact" href="tel:+32492865800">0492 865 800</a><i className="fab fa-2x fa-linkedin"></i>&nbsp;<i className="fab fa-2x fa-github-square"></i>
            </div>
        </div>
    </div>
  
 )
}
  
export default ContactSection;
